import React, { useState, useEffect } from 'react';
import { AppBar, Typography, Toolbar, Avatar, Button, Paper} from '@material-ui/core';
// import { useNavigate, useLocation } from 'react-router-dom';
// import { useDispatch } from 'react-redux';
import useStyles from './styles';

const MainProfile = () => {
    const [user, setUser] = useState(JSON.parse(localStorage.getItem('profile')));
    // const dispatch = useDispatch();
    // const location = useLocation();
    // const navigate = useNavigate();
    const classes = useStyles();

    return (
        <div>
            <Paper elevation={0}>
                <Avatar sx={{ width: 500, height: 500 }} className={classes.purple} alt={user?.result.name} src={user?.result.imageUrl}>{user?.result.name.charAt(0)}</Avatar>
            </Paper>
        </div>
    )
}

export default MainProfile;
